import React, { useState, useRef } from 'react';
import {useNavigate} from "react-router-dom";

function NewTask() {

  const navigate = useNavigate();

   /*Переход на страницу Список задач по клику */
  function goToApp(){
    navigate(-1)
  }
  
  function addNewTask() {
    alert(111);
  }
  
    return (
      <div className="App">
      <header className="App-header">
       <div className='mainDiv'>
        <button className='goToButton marginNewTask' onClick={goToApp}>Назад к списку задач</button>
        <textarea className='TitleTaskTextarea marginNewTask' placeholder='Название задачи'></textarea>
        <textarea className='TextTaskTextarea marginNewTask' placeholder='Текст Задачи'></textarea>
        <button className='addNewTask' onClick={addNewTask}>Добавить Задачу</button>
       </div>
      </header>
    </div>
    )
  }
  
  export default NewTask;
